message: "Chúng tôi đơn vị thi công có uy tín hàng đầu trong lĩnh vực mài sàn bê tông, có bề dày kinh \r\nnghiệm tại Đà Nẵng,  là một thành phố phát triển, Đà \r\nNẵng có rất nhiều cơ sở thương mại được xây dựng và sử dụng sàn bê tông đánh bóng \r\nVới đội ngũ công nhân viên đông đảo, chuyên môn cao,  đã qua trường lớp đào tạo nâng cao  và sở hữu những thiết bị hiện đại bậc nhất thế giới hiện nay,\r\ngiúp đẩy nhanh thời gian thi công, giảm \r\ngiá thành, chất lượng dịch vụ được bảo đảm\r\nDịch vụ mài nền xi măng ở tại Đà Nẵng của chúng tôi sẽ mang lại những bề mặt sàn bê tông được hoàn thiện nhất \r\ncho công trình thi công"
